import Nav from "../components/Navbar";
import Ds from '../assets/Dss.jpeg'
import '../styles/home.css'
import {fetchTicket} from '../api/home.js'
function Home() {
    const [movieList, setMovieList] = useState([]);
    useEffect(() => {
        (async () => {
            fetchTicket().then(function (response) {
                if (response.status === 200) {                    
                    setMovieList(response.data);                      
                }
            }).catch(function (error) {
                    if(error.response.status===401){
                        localStorage.clear();
                        window.location.href ="/"
                    }
                    console.log(error);
                });
        })();

      }, []);

      return (
        <>
           <Nav />
           <div className="container mx-5 my-2">
               <p className="fw-bolder">Recomended Movies</p>
               <div className="row">
                   <div className="col d-flex h-100">
                       <div className="card rounded-pill" style={{height: 20 + "rem", width: 15 + "rem"}}>
                           <img src={"https://m.media-amazon.com/images/M/MV5BOWE5ZjljZDEtYTZmNy00MGVlLWJjNjEtMWUwMzUyMDc5NTA3XkEyXkFqcGdeQXVyODgzMDMwODI@._V1_.jpg"} class="card-img-top" alt="..."/>
                           <div className="bg-dark text-white py-2 top">
                           <i class="bi bi-hand-thumbs-up-fill p-2 text-success">58k </i>
                           </div>
                       </div>
                   </div>
                   <div className="col d-flex h-100">
                       <div className="card rounded-pill" style={{height: 20 + "rem", width: 15 + "rem"}}>
                           <img src={Ds} class="card-img-top" alt="..."/>
                           <div className="bg-dark text-white py-2 top">
                           <i class="bi bi-hand-thumbs-up-fill p-2 text-success">58k </i>
                           </div>
                       </div>
                   </div>
                   <div className="col d-flex h-100">
                       <div className="card rounded-pill" style={{height: 20 + "rem", width: 15 + "rem"}}>
                           <img src={Ds} class="card-img-top" alt="..."/>
                           <div className="bg-dark text-white py-2 top">
                           <i class="bi bi-hand-thumbs-up-fill p-2 text-success">58k </i>
                           </div>
                       </div>
                   </div>
               </div>
           </div>
        </>
    )
}

export default Home;
